function User(e,t){this.username=e,this.uid=t}function Theme(e,t,o,a,r,n){this.author=new User(e,a),this.title=t,this.info=o,this.osthm_version=n,this.theme_data=r}var CrossData;async function getThemes(){return await fetch("https://teammusic-tw.firebaseio.com/upload/themes.json").then(e=>e.json()).then(e=>{var t=[];for(key in e){let o=e[key],a=JSON.parse(o.themesjson);t.push(new Theme(o.themesauthor,o.themesname,o.themesinfo,o.uid,a,o["os-thm-version"]))}return CrossData=t,t})}function selectTheme(e){try{localStorage.setItem("theme",JSON.stringify(CrossData[e]))}catch(e){return alert(e),e}alert("Succesfully")}function setTextColor(e){document.getElementById(e).style.color=JSON.parse(localStorage.getItem("theme")).theme_data[0].colorBackgroundText}function setBackgroundColor(e){document.getElementById(e).style.background=JSON.parse(localStorage.getItem("theme")).theme_data[0].colorBackground}function setBarLightColor(e){document.getElementById(e).style.background=JSON.parse(localStorage.getItem("theme")).theme_data[0].colorPrimary}function setBarDarkColor(e){document.getElementById(e).style.background=JSON.parse(localStorage.getItem("theme")).theme_data[0].colorPrimaryDark}function setCardColor(e){document.getElementById(e).style.background=JSON.parse(localStorage.getItem("theme")).theme_data[0].colorPrimaryCardTint}
